pragma solidity ^0.8.0;

contract ComplexData{
    uint [] public arr;
    function pushElement(uint value)public {
        arr.push(value);

    }

    function popElement() public {
        arr.pop();
    }
    function getLength() public view returns(uint){
        return arr.length;
    }
    
